import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  padding: 40px;
  background: linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%);
`;

const ProviderTypeBreakdown = () => {
  return (
    <Container>
      <h2>Provider Type Breakdown</h2>
      <p>Detailed analysis of different provider types serving pregnant and postpartum patients.</p>
    </Container>
  );
};

export default ProviderTypeBreakdown;
